import React from 'react';

function AreUreSurePopup() {
  return (
      <>
        <aside id="areYouSureToDelete" class="popup">

          <div class="popup__container">
            <button id="areYouSureToDelete_closeButton" class="popup__close-button" type="button">
            </button>

            <form id="popupFormАreYouSureToDelete" class="popup__form" name="popup_areYouSureToDelete" novalidate>
                <h3 class="popup__title">Вы уверены?</h3>
                <button
                    id="popup_areYouSureToDelete_button"
                    type="submit"
                    class="popup__button popup__yes-button">Да</button>
            </form>
          </div>

        </aside>
      </>
  );
}

export default AreUreSurePopup;
